selector_to_html = {"a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>To find the transfer function <span class=\"math notranslate nohighlight\">\\(G(s) = \\frac{Y(s)}{U(s)}\\)</span>, we apply the Laplace transform to the ODE, assuming zero initial conditions (<span class=\"math notranslate nohighlight\">\\(\\dot{y}(0) = y(0) = 0\\)</span>).</p><p>Recall that <span class=\"math notranslate nohighlight\">\\(\\mathcal{L}[\\dot{y}(t)] = s Y(s)\\)</span> and <span class=\"math notranslate nohighlight\">\\(\\mathcal{L}[\\ddot{y}(t)] = s^2 Y(s)\\)</span>.</p>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p><strong>Zeros</strong>: The roots of the numerator. Here, the numerator is <span class=\"math notranslate nohighlight\">\\(1\\)</span> (a constant), so there are <strong>no zeros</strong>.</p><p><strong>Poles</strong>: The roots of the denominator <span class=\"math notranslate nohighlight\">\\(D(s) = s^2 + 3s + 2\\)</span>. We solve <span class=\"math notranslate nohighlight\">\\(s^2 + 3s + 2 = 0\\)</span>.</p>", "a[href=\"#solutions-of-exercise-1-0\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 1.0<a class=\"headerlink\" href=\"#solutions-of-exercise-1-0\" title=\"Link to this heading\">#</a></h1><p>Consider a simple mechanical system described by a mass <span class=\"math notranslate nohighlight\">\\(m\\)</span>, a spring constant <span class=\"math notranslate nohighlight\">\\(k\\)</span>, and a damping coefficient <span class=\"math notranslate nohighlight\">\\(c\\)</span>. The system is subjected to an external force <span class=\"math notranslate nohighlight\">\\(u(t)\\)</span>, and its position <span class=\"math notranslate nohighlight\">\\(y(t)\\)</span> evolves according to the following linear ordinary differential equation (ODE):</p>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>To find the transfer function <span class=\"math notranslate nohighlight\">\\(G(s) = \\frac{Y(s)}{U(s)}\\)</span>, we apply the Laplace transform to the ODE, assuming zero initial conditions (<span class=\"math notranslate nohighlight\">\\(\\dot{y}(0) = y(0) = 0\\)</span>).</p><p>Recall that <span class=\"math notranslate nohighlight\">\\(\\mathcal{L}[\\dot{y}(t)] = s Y(s)\\)</span> and <span class=\"math notranslate nohighlight\">\\(\\mathcal{L}[\\ddot{y}(t)] = s^2 Y(s)\\)</span>.</p>", "a[href=\"#question-5\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 5<a class=\"headerlink\" href=\"#question-5\" title=\"Link to this heading\">#</a></h3><p>The static gain (or DC gain) is found by evaluating the transfer function at <span class=\"math notranslate nohighlight\">\\(s=0\\)</span>.</p>", "a[href=\"#question-4\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 4<a class=\"headerlink\" href=\"#question-4\" title=\"Link to this heading\">#</a></h3><p>For a first-order system (or a system approximated by its dominant pole), the step response is proportional to <span class=\"math notranslate nohighlight\">\\(1 - e^{-t/\\tau}\\)</span>.</p><p>A common empirical rule for estimating the settling time is:</p>", "a[href=\"#question-3\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3<a class=\"headerlink\" href=\"#question-3\" title=\"Link to this heading\">#</a></h3><p>The <strong>dominant pole</strong> is the pole closest to the imaginary axis (i.e., the one with the smallest absolute real part, or largest time constant).</p><p>Comparing <span class=\"math notranslate nohighlight\">\\(p_1 = -1\\)</span> and <span class=\"math notranslate nohighlight\">\\(p_2 = -2\\)</span>, <span class=\"math notranslate nohighlight\">\\(p_1\\)</span> is closer to <span class=\"math notranslate nohighlight\">\\(0\\)</span>.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
